So glad we can let the cat out of the bag with these presenters and nominees! 

Thank you @get_fitwith_dee @viptravelgirl @mercedesdoesvsg @metamorphasteph for taking time out your busy lives to help support by being such a beacon of inspiration for all the people in this community! We can't do these events or give support without the help of you guys and all the other lovely people that are going to be showing up on September 30th in Washington DC!

Thank you to everyone who hopped on and spent time with all of us talking all things JBY! We are getting more and more excited to be in DC with our bari friends!! Especially our co-hosts for the show @thebusinessbully & @myweightishistory

We want to take a second to thank our AMAZING sponsors, they believe in our mission to bring the bariatric community into the light and who are making this incredible event possible! 

